    [],nt"num_tags": 3,nt"name": "narrative-report-morton-national-wildlife-refuge-may-1-august-31-1960",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Morton National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1960.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. The public relations section of the report
    describes recreational uses, Refuge visitors, and Refuge participation. Items of
    interest, N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
